services:
  childchain:
    environment:
      - ETHEREUM_WS_RPC_URL=ws://geth:8545
  watcher:
    environment:
      - ETHEREUM_WS_RPC_URL=ws://geth:8545
  plasma-contracts:
    environment:
      - MIN_EXIT_PERIOD=1
